import { Grid, Card, Image, Divider, Dropdown, } from 'semantic-ui-react'
import { NavLink } from 'react-router-dom'
import UserOrder from './UserOrder'

export default class History extends React.Component {

    renderUserOrders = () => { return this.props.user.orders.map(order => {
        return  <div class="four wide column"> <UserOrder order={order}/>  </div>
            }) 
        }      

    render() {

        return (
            <>
                <center>
                    <Divider hidden/>
                <h1>{this.props.user.first_name}'s History</h1>
                <div class="ui container">
            <div class="ui equal width grid">
                {this.renderUserOrders()}
            </div>
        </div>
                </center>


        </>

        )
    }

}
